import { Component } from "react";
const axios = require ('axios');



class Ingreso extends Component{  
    render(){
        return(
            <div>
                <form>
                    Email: <input type='email' className="element" id='email' ></input><br/>
                    pass: <input type='password' className="element" id='pass' ></input><br/>
                </form>
                <button className="element" onClick={()=>{console.log(document.getElementById('email').value)}}>Ingresar</button>
            </div>
        )
    }

    
}

export default Ingreso;
